2. **Requirement**: The requirement is to close the previously opened tooltip when a new one is opened. This implies that there needs to be a way for the `Tooltip` components to communicate with each other.
3. **Solution Approach**: To achieve this, we can use React Context to share state between the `Tooltip` components. We will create a context that manages the state of the tooltips and provides a way to update this state.

